import React from 'react';
import Form from './Form';
import Api from './Axioms_components/Api';
import Post from './Axioms_components/PostApi';
import { BrowserRouter, Routes } from 'react-router-dom';
// import Counter from './Counter';
import './index.css';

function App(){
return(
<BrowserRouter>
<Routes></Routes>
<Form/>
<Api/>
<Post/>
</BrowserRouter>
);
}
export default App;
